
// #region Image Data

var imgLinkHorde = "data:image/png;base64,";
var imgLinkAlliance = "data:image/png;base64,";
// #endregion

$(document).ready(function () {
	$.extend($.fn.dataTable.defaults, {
		searching: false,
		lengthChange: false,
		paging: false
	});

	var dataTable = $('#TopTable2').DataTable({
		"ajax": "../../search/recent-search-data",
		select: true,
		"createdRow": function (row, data, index) {
			$(row).addClass("clickable");
		},
		"language": {
			info: "",
			emptyTable: "",
		},
		"order": [[5, "asc"]],
		"columns": [
			{ "data": "name" },
			{ "data": "level" },
			{ "data": "class" },
			{ "data": "playerGUID", "visible": false },
			{ "data": "race", "visible": false },
			{ "data": "createdAt", "visible": false },
			{ "data": "updatedAt", "visible": false },
			{ "data": "updatedBy", "visible": false }

			//{ "data": "viewdate" },
			//{ "data": "realmid", "visible": false },
			//{ "data": "sort", "visible": false }
		],
		responsive: {
			details: false
		},
		columnDefs: [
			{
				targets: 2,
				orderable: false,
				render: function (data, type, row) {

					var color = '';
					switch (data) {
						case "Rogue":
							color = 'rgb(255, 244, 104)';
							break;
						case "Mage":
							color = 'rgb(104, 204, 239)';
							break;
						case "Warrior":
							color = 'rgb(198, 155, 109)';
							break;
						case "Druid":
							color = 'rgb(255, 124, 10)';
							break;
						case "Warlock":
							color = 'rgb(147, 130, 201)';
							break;
						case "Priest":
							color = 'rgb(240, 235, 224)';
							break;
						case "Paladin":
							color = 'rgb(244, 140, 186)';
							break;
						case "Hunter":
							color = 'rgb(170, 211, 114)';
							break;
						case "Shaman":
							color = 'rgb(35, 89, 255)';
							break;
					}
					return '<span style="color:' + color + '">' + data + '</span>';
				}
			},
			{
				targets: 0,
				orderable: false,
				render: function (data, type, row) {
					var classId = row['class'];
					var color = '';
					switch (classId) {
						case "Rogue":
							color = 'rgb(255, 244, 104)';
							break;
						case "Mage":
							color = 'rgb(104, 204, 239)';
							break;
						case "Warrior":
							color = 'rgb(198, 155, 109)';
							break;
						case "Druid":
							color = 'rgb(255, 124, 10)';
							break;
						case "Warlock":
							color = 'rgb(147, 130, 201)';
							break;
						case "Priest":
							color = 'rgb(240, 235, 224)';
							break;
						case "Paladin":
							color = 'rgb(244, 140, 186)';
							break;
						case "Hunter":
							color = 'rgb(170, 211, 114)';
							break;
						case "Shaman":
							color = 'rgb(35, 89, 255)';
							break;
					}
					var imgLink = imgLinkAlliance;
					if (row['faction'] == "Horde") {
						imgLink = imgLinkHorde;
					}
					console.log(row['faction']);
					return '<img src="' + imgLink + '" style="height: 20px; margin-right: 4px; margin-top: -5px;   "/><span style="color:' + color + '">' + data + '</span>';
				}
			},
			{
				targets: [3, 1],
				orderable: false
			}
		],
	});
});
